COPY topics (id, content, is_active, created_at, user_id, title, category_id) FROM stdin;
1	<p>🔆 Kế từ thứ tư, ngày 08/07/2020, Langf.vn sẽ chính thức dừng toàn bộ các hoạt động kết nối cửa hàng và các dịch vụ về giao - nhận tại Khu Đô thị Đại học Quốc gia TPHCM trên hệ thống https://langf.vn</p><p>📌 Đây là một <strong>quyết định </strong>khó khăn của đội ngũ phát triển, tuy nhiên là cần thiết trong giai đoạn này nhằm tập trung cho các dự án sắp tới.</p><p>❤️ Xin chân thành cảm ơn vì sự quan tâm và ủng hộ của các bạn trong hơn 2 năm vừa qua. Hy vọng sẽ có cơ hội quay trở lại phục vụ các bạn, trong một diện mạo, một hình thức mới?!</p><p>Loveyou3000 &lt;3\r\n</p><p>#langfvn</p><p>#fastecomjsc</p>	t	2020-07-08 03:40:35+00	1	Langf.vn sẽ chính thức dừng toàn bộ các hoạt động	1
2	<p>Người ta nói, đã là sinh viên Làng, ai cũng phải thử qua tàu hũ cổng sau Đại học Thể dục Thể thao. Cứ thế, suốt 20 năm nay, gánh tàu hũ má Ái như một thức quà thanh xuân, lưu giữ biết bao kỷ niệm của sinh viên Làng Đại học Thủ Đức (TP.HCM).</p><p><em>-&nbsp;Tàu hũ cổng sau hông bây!</em></p><p><br></p><p>-&nbsp;<em>&nbsp;Đi chớ… Nay nóng, tao phải ăn 3 chén cho đã.</em></p><p><br></p><p>Hồi cái thời còn là sinh viên của trường ĐH KHXH &amp; NV TP.HCM, chiều nào chúng tôi cũng có cái hẹn mỗi giờ tan trường như thế. Rồi sau này ra trường, mỗi đứa một ngã, thế mà lâu lắm thèm chén tàu hũ nóng đầy ụ nước cốt dừa, cũng lại xách xe chạy từ trung tâm thành phố về Làng. Chẳng để làm gì cả, chỉ là ngồi ghế nhựa, quanh cái gánh tàu hũ đỏ than hồng, mà nghe má Ái vừa trách vừa thương: Đi lâu mau mà quên mất tui thiệt rồi sao?</p><p>Cứ thế, hai mươi năm nay, gánh tàu hũ nằm một góc nhỏ cổng sau Đại học Thể dục Thể thao như một thức quà làm vui cho bao thế hệ sinh viên<a href="https://saostar.vn/sinh-vien-tv/co-mot-mua-yeu-no-ro-khap-neo-duong-tinh-ven-lang-dai-hoc-khien-bao-cap-doi-sinh-vien-thon-thuc-4794701.html" rel="noopener noreferrer" target="_blank" style="color: rgb(237, 28, 36);"><strong>&nbsp;Làng Đại học</strong></a>.</p><p><img src="data:image/jpeg;base64,"></p>	t	2020-07-08 03:41:24.935407+00	4	Các món ăn ngon nhất làng đại học	1
3	<p><span style="color: rgb(28, 30, 33);">TTO - Kiểu tội phạm rạch đùi phụ nữ lại xuất hiện khi mới đây một nữ sinh trên đường đi học về bị kẻ lạ dùng vật sắc nhọn rạch đùi gây thương tích ở quận 12, TP.HCM.</span></p><p><br></p><p class="ql-align-center"><img src="data:image/jpeg;base64,"></p><p><br></p><p><span style="color: rgb(28, 30, 33);">Sáng 7-7, nguồn tin Tuổi Trẻ Online cho biết Công an quận 12, TP.HCM đang lập hồ sơ, điều tra vụ một nữ sinh bị rạch đùi gây thương tích phải đưa vào bệnh viện sơ cứu, điều trị.</span></p><p><br></p><p><span style="color: rgb(28, 30, 33);">Nạn nhân là nữ sinh X.N., 17 tuổi, ngụ huyện Hóc Môn, TP.HCM.</span></p><p><br></p><p><span style="color: rgb(28, 30, 33);">Theo thông tin ban đầu, khoảng 10h45 sáng 4-7, sau khi học xong ở trường, N. được bạn chở về nhà. Khi đang đi trên đường TCH10 (khu phố 9, phường Tân Chánh Hiệp, quận 12) thì bị hai thanh niên lái xe máy áp sát từ phía sau.</span></p><p><br></p><p><span style="color: rgb(28, 30, 33);">Lúc này, thanh niên ngồi sau xe máy dùng một vật sắc nhọn (nghi là dao rọc giấy) rạch vào đùi nữ sinh N. gây thương tích rồi tẩu thoát.</span></p><p><br></p><p><span style="color: rgb(28, 30, 33);">Sau đó, N. được người thân đưa đi bệnh viện sơ cứu với vết thương ở đùi trái khoảng 10cm.</span></p><p><br></p><p><span style="color: rgb(28, 30, 33);">Nhận tin báo, Công an phường Tân Chánh Hiệp ghi nhận lời khai, lập hồ sơ chuyển Công an quận 12 điều tra.</span></p><p><br></p><p><span style="color: rgb(28, 30, 33);">Trước đó, tại TP.HCM và nhiều tỉnh thành từng xuất hiện kiểu tội phạm cố ý gây thương tích bằng cách dùng dao lam, dao rọc giấy rạch đùi, mông phụ nữ khiến dư luận bức xúc.</span></p><p><br></p><p><span style="color: rgb(28, 30, 33);">Ảnh minh họa</span></p><p><span style="color: rgb(28, 30, 33);">Theo Tuổi Trẻ</span></p><p><span style="color: rgb(28, 30, 33);">Nguồn: Tôi là dân Thủ Đức</span></p>	t	2020-07-08 03:42:01+00	6	Lại xuất hiện vụ rạch đùi nữ sinh tại TP.HCM	1
4	<p class="ql-align-justify">Chắc các bạn học sinh, sinh viên ai củng đã từng nghe qua cái tên&nbsp;<strong>làng đại học Thủ Đức</strong>. Vì sao ngôi làng này lại có cái tên như thế vì đây là nơi tập chung các trường đại học danh tiếng hàng đầu của trường đại học thành phố Hồ Chí Minh</p><p class="ql-align-center"><img src="https://top10truonghoc.com/wp-content/uploads/2019/08/L-dh.jpg" alt="làng đại học" height="500" width="800"></p><p class="ql-align-center"><em>Làng đại học</em></p><p class="ql-align-justify">Các trường luôn tạo uy tín và chất lượng cao làng đa là nơi mà các học sinh và phụ huynh luôn quan tâm. Chúng ta cùng tìm hiểu qua các trường đại học ở thủ đức</p><h2 class="ql-align-justify">Các Trường Đại Học ở Làng Đại Học</h2><p class="ql-align-justify">Điểm danh qua các trường thuộc khối đại học quốc gia ở&nbsp;<strong>làng đại học thủ đức</strong>:</p><h3 class="ql-align-justify">Đại Học Bách Khoa Thành Phố Hồ Chí Minh</h3><p class="ql-align-justify">Là ngôi trường đáng tin cậy, là cơ sở đào tạo uy tín nhất trong việc tào đạo chuyên ngành kỹ thuật. Trường có 2 cơ sở, cơ sở 1 nằm ở quận 10, còn cơ sở còn lại nằm trong&nbsp;<strong>làng đại học thủ đức</strong>. Cơ sở 2 là cơ sở phục vụ cho các bạn tân sinh viên theo học khối kiến thức đại cương</p><p class="ql-align-justify">Trường đại học bách khoa trải qua 55 năm hình thành và phát triển với sứ mệnh đào tạo sinh viên các ngành học kỹ thuật.</p><p class="ql-align-justify">Đội ngũ giảng viên đông đảo đa số có trình độ thạc sĩ, tiến sĩ. Trường tổ chức nhiều hoạt động ngoại khóa và tổ chức các clb thể thao</p><h3 class="ql-align-justify">Đại Học Kinh Tế – Luật</h3><p class="ql-align-justify">Là địa chỉ đáng tin cậy, các phụ huynh và sinh viên luôn đặt lòng tin vào trường. Trường đào tạo các chuyên ngành kinh tế, quản lý và luật học với sứ mạng thúc đẩy sự phát triển và tiến bộ xã hội thông qua nghiên cứu, đào tạo và cung ứng dịch vụ chất lượng cao trong lĩnh vực kinh tế, luật và quản lý</p><p class="ql-align-justify">Trường nằm trong&nbsp;<strong>làng đại học thủ đức</strong>&nbsp;gồm 70 phòng học , 2 thư viện , 6 phòng máy tính , 11 phòng ngoại ngữ, 3 phòng thực hành và các văn phòng làm việc, các phòng học lý thuyết đều trang bị hệ thống âm thanh và máy chiếu.</p><p class="ql-align-justify">Trường có đội ngũ giảng viên có trình độ chuyên môn cao trong đó có một số chuyên gia đầu ngành có uy tín, trường tổ chức nhiều hoạt động ngoại khóa bởi nhiều câu lạc bộ</p><h3 class="ql-align-justify">Đại Học Khoa Học Tự Nhiên</h3><p class="ql-align-justify">Trường giữ vai trò rất lớn trong việc đào tạo ra các nhà khoa học trẻ cho đất nước về hai lĩnh vực khoa học xã hội và khoa học tự nhiên là ngôi trường mơ ước của rất nhiều bạn trẻ. Trường có 2 cơ sở, cơ sở 1 nằm ở quần 5, còn cơ sở 2 nằm ở&nbsp;<strong>làng đại học Thủ Đức</strong>.</p><p class="ql-align-justify">Là ngôi trường cung cấp nguồn nhân lực, đội ngũ chuyên gia trình độ cao trong lĩnh vực khoa học.</p><p class="ql-align-justify">Các phòng học được trang bị quạt, máy lạnh phục vụ cho sinh viên, các ngành như công nghệ thông tin, sinh học, khoa học với các phòng đều có thiết bị hiện đại, trường còn có cả trung tâm tin học. trường còn tạo điều kiện để các bạn sinh viên tham gia các hoạt động ngoại khóa</p><h3 class="ql-align-justify">Đại Học Quốc Tế – Đại Học Quốc Gia Thành Phố Hồ Chí Minh</h3><p class="ql-align-justify">Ngôi trường đầu tiên ứng dụng mô hình đào tạo quốc tế vào quá trình giảng dạy và nghiên cứu. Trường tập trung đào tạo vào các chuyên ngành như: kinh tế, kỹ thuật, công nghệ</p><p class="ql-align-center"><img src="https://top10truonghoc.com/wp-content/uploads/2019/08/dh-qt.jpg" alt="đại học quốc tế" height="500" width="800"></p><p class="ql-align-center"><em>đại học quốc tế</em></p><p class="ql-align-justify">Trường tổ chức hơn 50 câu lạc bộ tao cơ hội cho sinh viên trao dồi thêm kỹ năng, trường có 2 cơ sở chính, một cơ sở nằm ở quận 1, cơ sở còn lại nằm trong<strong>&nbsp;làng đại học Thủ Đức</strong>. Trường có nhiều phòng thí nghiệm, Thư viện hiện đại, trang thiết bị đầy đủ</p><p class="ql-align-justify">Lực lượng giảng viên hung hậu bao gồm thạc sĩ, tiến sĩ , giáo sư và phó giáo sư</p><h3 class="ql-align-justify">Đại Học Công Nghệ Thông Tin Thành Phố Hồ Chí Minh</h3><p class="ql-align-justify">Được thành lập hơi muộn so với các trường khác nhưng trường đại học công nghệ thông tin ngay lập tức khẳng định được giá trị của mình trong việc đào tạo, giảng dạy về công nghệ thông tin. Trường nằm trong&nbsp;<strong>làng đại học Thủ Đức</strong></p><p class="ql-align-justify">Các sinh viên của trường sẻ được học tập và nghiên cứu trong môi trường đầy đủ tiện nghi đồng thời được học các lớp liên kết với các Tập đoàn hàng đầu về công nghệ thông tin như IBM, Microsoft, SunJava.</p><p class="ql-align-justify">rường có đội ngũ giảng viên với trình độ chuyên môn cao. Đa số cán bộ giảng dạy của Trường tốt nghiệp từ các trường, viện uy tín trong và ngoài nước như trường Đại học Bách Khoa TP.HCM, trường Đại học Khoa học và Tự nhiên TP.HCM, Đại học Telecom ParisTech (Pháp), Đại học California, Los Angeles (Hoa Kỳ), Đại học Portsmouth (Anh), , Đại học LinZ (Áo), Đại học Kỹ thuật điện quốc gia Xanh-Petécbua (Nga), Đại học Kỹ thuật Curtin (Úc), Đại học Sokendai (Nhật Bản)…</p><p class="ql-align-justify"><br></p><h3 class="ql-align-justify">Kết luận:</h3><p class="ql-align-justify">Đây là 5 trường đào tạo đại học chất lượng bậc nhất thành phố Hồ Chí Minh nằm trong&nbsp;</p><p class="ql-align-justify"><strong>làng đại học Thủ Đức</strong>. Là những ngôi trường mà các bạn trẻ đầu lấy làm mục tiêu để hướng đến. Trong làng đại học còn nhiều ngôi trường và nhiều điều thú vị khác mà các bạn sinh viên cần phải tìm hiểu. Chúc các bạn thành công</p>	t	2020-07-08 03:50:42.207897+00	4	Làng đại học bao gồm những trường đại học nào?	1
