7	<p>Không chỉ là nơi tập trung những trường đại học thuộc hệ thống đại học quốc gia, làng đại học còn có những địa điểm giải trí, vui chơi dành cho sinh viên sau giờ học căn thẳng. Bên cạnh hoạt động chợ đêm, rạp chiếu phim thì hồ Đá và suối Nhum là nơi có “phong cảnh hữu tình” nhất, đồng thời cũng là nơi nguy hiểm nhất.</p><p><br></p><p><strong>Hồ Đá</strong></p><p><br></p><p>Nhắc đến làng đại học quốc gia thành phố Hồ Chí Minh, nhiều người lập tức nghĩ đến hồ Đá. Hồ Đá tiếng gần xa với phong cảnh đẹp, không khí mát mẻ. Sở hữu hồ nước rộng bao la với những vách đá đưa ra, mang một vẻ đẹp khoáng đãng, hồ Đá là nơi lý tưởng cho sinh viên tụ tập và hẹn hò.</p><p>&nbsp;</p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD1-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 1"></em></p><p class="ql-align-center"><em>Hồ Đá thoáng đãng</em></p><p class="ql-align-center"><br></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:thumb_w/600/BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD2-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 2"></em></p><p class="ql-align-center"><em>Phong cảnh nên thơ</em></p><p class="ql-align-center"><br></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:thumb_w/600/BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD3-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 3"></em></p><p class="ql-align-center"><em>Cảnh hoàng hôn ở hồ Đá</em></p><p class="ql-align-center"><br></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD4-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 4"></em></p><p class="ql-align-center"><em>Mặt hồ phẳng lặng, rộng bát ngát</em></p><p><br></p><p>Hồ đá là một hồ nước nhân tạo. Sự ra đời của hồ Đá là kết quả của việc khai thác đá để lại. Sau một thời gian, nước mưa và các mạch nước ngầm trong đá chảy ra tạo thành hồ. Khu vực hồ Đá bao gồm bốn hồ nước sâu hơn 60 mét, nước trong hồ quanh năm lạnh giá. Bao quanh hồ là những dốc đá lởm chởm dựng đứng với những lối đi cheo leo do nhiều người thường xuyên lui tới.&nbsp;</p><p>&nbsp;</p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD6-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 5"></em></p><p class="ql-align-center"><em>Vách đá cheo leo</em></p><p class="ql-align-center"><br></p><p>Không chỉ đến hò hẹn, nhiều bạn còn đến hồ Đá bơi lội hay tìm kiếm cảm giác mạnh khi phóng từ trên vách đá cao dựng đứng xuống lòng hồ bất chấp dòng nước lạnh giá và những mỏm đá ngầm ẩn dưới mặt nước phẳng lặng.</p><p><br></p><p>Nước trong hồ luôn ở trạng thái đứng do không có dòng chảy. Các thợ lặn cho biết, cấu tạo lòng hồ rất phức tạp, độ sâu thay đổi đột ngột, chỉ cần xê dịch vài phân độ sâu có thể thay đổi cả mét. Thêm vào đó, hồ hình thành từ núi đá nên hai bên bờ chỉ toàn đá sỏi, sơ ý một chút đã rơi xuống lòng hồ.&nbsp;</p><p>&nbsp;</p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:thumb_w/600/BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD7-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 6"></em></p><p class="ql-align-center"><em>Dù biết nguy hiểm nhưng các bạn sinh viên ở các khu vực quanh đó vẫn cứ bơi lội ở hồ Đá</em></p><p class="ql-align-center"><em>&nbsp;</em></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD8-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 7"></em></p><p class="ql-align-center"><em>“Phi thân” thử cảm giác mạnh</em></p><p class="ql-align-center"><br></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD5-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 8"></em></p><p class="ql-align-center"><em>Các bạn nữ cũng không hề thua kém các bạn nam trong mức độ mạo hiểm</em></p><p><br></p><p><br></p><p>Với những đặc điểm khó lường, hồ Đá không chỉ là nơi nảy sinh những mối tình thơ mộng mà còn là địa điểm gắn với những cái chết tức tưởi. Với thống kê không chính thức, hồ Đá đã cướp đi gần 60 sinh mạng của công nhân, sinh viên và người dân địa phương. Vì vậy, nhiều người còn gọi hồ Đá là “Hồ Tử Thần”.</p><p>&nbsp;</p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD9-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 9"></em></p><p class="ql-align-center">&nbsp;<em>Hồ Đá còn là studio chụp ảnh cưới mặc dù rất nguy hiểm</em></p><p class="ql-align-center"><br></p><p>Nhận thấc mức độ nguy hiểm của hồ Đá, cơ quan chức năng đã cho làm hàng rào xung quanh hồ và khuyến cáo mọi người hạn chế đến khu vực này, tuy nhiên cách làm này không có mấy hiệu quả. Bỏ qua các biển báo nguy hiểm, nhiều bạn trẻ vẫn chọn đây là địa điểm vui chơi. Không chỉ vậy, một số đoạn rào chắn còn bị những người thiếu ý thức cắt bỏ để tiện cho việc tiếp cận xung quanh hồ Tử Thần.</p><p>&nbsp;</p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:thumb_w/600/BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD10-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 10"></em></p><p class="ql-align-center"><em>Bảng cảnh báo có cũng như không</em></p><p class="ql-align-center"><em>&nbsp;</em></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD11-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 11"></em></p><p class="ql-align-center"><em>Tấm bảng báo giờ chỉ còn là tấm bảng rỉ sét</em></p><p class="ql-align-center"><em>&nbsp;</em></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/HD12-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 12"></em></p><p class="ql-align-center"><em>Đoạn rào bị những người thiếu ý thức cắt bỏ</em></p><p><br></p><p><strong>Suối Nhum</strong></p><p><br></p><p>Tuy không nổi tiếng bằng hồ đá nhưng suối Nhum cũng là một địa điểm “khét tiếng” trong khu vực làng đại học quốc gia. Dòng suối chảy giữa những tán cây xanh ngắt, lại chảy ngang qua con đường dẫn về kí túc xá khu B nên suối Nhum không mấy xa lạ với hầu hết sinh viên học tập và sinh sống trong làng đại học.</p><p>&nbsp;</p><p>Suối Nhum hợp lưu với suối Xuân Trường thành Suối Cái, chảy qua các phường Linh Xuân, Linh Trung (quận Thủ Đức), Tân Phú, Hiệp Phú (quận 9) rồi đổ ra sông Tắc và sông Đồng Nai.</p><p>&nbsp;</p><p>Cứ mỗi lần trời mưa, nước từ suối dâng lên rất nhanh, miệng cống lại nhỏ nên nước cứ tràn lên đường. Hai bên đường lại không có rào chắn nên rất nguy hiểm cho người qua lại. Suối Nhum đoạn chảy ngang đường dẫn về kí túc xá có chiều ngang khoảng 3 mét, sâu hơn 2 mét. Con đường nội bộ sang suối cũng chỉ rộng khoảng 3 mét, phía dưới đặt 3 ống cống nhỏ và quanh miệng có bờ kè đá. Nhiều phụ huynh đưa con em đến kí túc xá khu B làm thủ tục đăng ký, thấy con đường này đã vội vã kiếm nhà trọ gần trường hoặc ở khu vực khác chứ không dám ở kí túc xá khu B mặc dù ở đây vẫn còn chỗ ở.&nbsp;</p><p>&nbsp;</p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/S1-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 13"></em></p><p class="ql-align-center"><em>Rạch suối Nhum ngập nặng sau trời mưa</em></p><p class="ql-align-center"><br></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/S2-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 14"></em></p><p class="ql-align-center"><em>Mỗi lần mưa, nước suối dâng lên cuồn cuộn</em></p><p>&nbsp;</p><p class="ql-align-center"><span style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/S4-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 15"></span></p><p class="ql-align-center"><em>Đoạn đường chỉ được đánh dấu bằng những cột mốc nhỏ</em></p><p class="ql-align-center"><br></p><p>Nữ sinh viên Đinh Thị Phương Thảo (vừa tốt nghiệp loại giỏi ngành Quản trị kinh doanh, Trường ĐH Kinh tế - Luật, ĐHQG TP.HCM) bị nước cuốn trôi vì một cơn mưa, ngay trên đường từ trường về ký túc xá khi đi ngang qua cống suối Nhum là một nạn nhân tiểu biểu của con suối tử thần này</p><p>&nbsp;</p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/S6-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 16"></em></p><p class="ql-align-center"><br></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/S7-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 17"></em></p><p class="ql-align-center"><br></p><p class="ql-align-center"><em style="color: transparent;"><img src="https://kenh14cdn.com/k:BTbXlm8EkGSICUZ2NYiccccccccccc/Image/2013/10/S8-f6b83/2-dia-diem-tho-mong-nhung-nguy-hiem-trong-lang-dai-hoc-tphcm.jpg" alt="2 địa điểm thơ mộng nhưng nguy hiểm trong làng đại học TP.HCM 18"></em></p><p class="ql-align-center"><em>Miệng cống nhỏ, không kịp thoát nước khi trời mưa làm nước tràn ngập lên đường</em></p><p><br></p>	t	2020-07-08 04:27:39.474027+00	4	Hồ đá làng đại học	1
8	<p>Chiều nay 15-5, TS Nguyễn Quốc Chính - giám đốc Trung tâm Khảo thí và đánh giá chất lượng đào tạo ĐH Quốc gia TP.HCM - cho biết ban giám đốc ĐH Quốc gia TP.HCM đồng ý điều chỉnh phương án tổ chức kỳ thi đánh giá năng lực 2020 chỉ 1 đợt duy nhất.</p><p>Theo đó, năm nay ĐH Quốc gia TP.HCM chỉ tổ chức 1 đợt thi đánh giá năng lực tại 5 địa phương: TP.HCM, Bến Tre, An Giang, Nha Trang (Khánh Hòa) và Đà Nẵng. Ngày thi chính thức sẽ được ĐH Quốc gia TP.HCM công bố khi Bộ GD-ĐT ban hành kế hoạch thi tốt nghiệp THPT, hướng dẫn công tác tuyển sinh ĐH năm 2020 chính thức.</p><p>Theo kế hoạch dự kiến mới, ngày thi đánh giá năng lực năm nay được ĐH Quốc gia TP.HCM tổ chức vào giữa tháng 8-2020, tức sau kỳ thi tốt nghiệp THPT khoảng 1 tuần.</p><p>"Việc điều chỉnh này nhằm bảo đảm an toàn cho thí sinh và xã hội trong bối cảnh dịch COVID-19 vẫn chưa hoàn toàn chấm dứt. Đồng thời, ĐH Quốc gia TP.HCM mong muốn thí sinh có thời gian chuẩn bị tốt cho kỳ thi" - ông Chính cho biết.</p><p><br></p><p>TS Nguyễn Quốc Chính cũng cho biết thí sinh có thể tiếp tục đăng ký dự thi cho đến hết ngày 15-6.</p><p>Toàn bộ kỳ thi đánh giá năng lực chỉ diễn ra trong một buổi sáng với bài thi tổng hợp gồm 120 câu trắc nghiệm với thời gian làm bài là 150 phút.</p><p class="ql-align-justify">Thí sinh có thể xem các thông tin liên quan đến kỳ thi, điểm thi cũng như tài liệu hướng dẫn đăng ký dự thi và đóng lệ phí dự thi tại địa chỉ website: http://thinangluc.vnuhcm.edu.vn/.</p>	t	2020-07-08 05:51:28.052054+00	12	Kì thi đánh giá năng lực Đại học Quốc gia TPHCM	5
9	<p class="ql-align-justify">Mario, Contra, Natra cứu mẹ,…hẳn là các tựa game cực kỳ quen thuộc gắn liền với tuổi thơ của nhiều thế hệ 8x, 9x trước đây. Cảm giác mà lén khi ba mẹ vắng nhà mở băng, đĩa lên chơi ắt ẳn không có gì xa lạ đâu đúng không??</p><p class="ql-align-justify">Tuần hè buồn buồn lượn lờ trên mạng vô phương hướng, MV của sếp’s thì đã cày view nát 2 cái IPX, Lol chess thì ngồi nghe Mạnh An chém gió cả nửa ngày, không còn gì đủ sức hấp dẫn nên thật sự là chán đcđ.</p><p class="ql-align-justify">Vậy mà thế bất nào lại gặp ngay cái mẫu quảng cáo&nbsp;<a href="https://shorten.asia/TNfnHky4" rel="noopener noreferrer" target="_blank" style="color: rgb(209, 20, 21);">Máy chơi game mini Sup 400&nbsp;</a>game mình thường chơi thời còn cởi chuồng tắm mưa. Thế là tò mò bấm vô xem và tò mò đặt thử trên&nbsp;<a href="https://shorten.asia/TNfnHky4" rel="noopener noreferrer" target="_blank" style="color: rgb(209, 20, 21);">Shopee</a>, chỉ tầm 130k bọ.</p><p class="ql-align-justify">Vlin thế bất nào đặt thứ 2 mà mới thứ 6 đã nhận được hàng, “nhanh” ghê. Vội vàng unbox luôn bộ, chụp choẹt vài tấm hình và làm review luôn cho ông bà đây.</p><p>Mở hộp ra thì hơi thất vọng với mấy mẹ shopee, quăng quật hàng mình như nào mà méo hết cả vỏ, éc éc</p><p><img src="data:image/jpeg;base64,"></p><p><span style="color: rgb(34, 34, 34);">Cũng may là điện nước bên trong vẫn đầy đủ, nội thất không bị hư hại gì, phùuuuu…</span></p>	t	2020-07-08 06:34:48.472028+00	5	Review máy chơi game mini Sup 400	6
